import React from "react";
import { Row, Col, Container } from "reactstrap";

import { CerradaDetalle, TextDetail, AbiertaDetalle } from ".";

const LayoutDetalle = (props) => {
  return (
    <div>
      <div className="page-wrapper d-block">
        <div className="page-content container-fluid">
          <Container>
            <Row>
              <Col sm={12} lg={12}>
                <TextDetail></TextDetail>
                <AbiertaDetalle></AbiertaDetalle>
              </Col>
            </Row>
          </Container>
        </div>
      </div>
    </div>
  );
};

export default LayoutDetalle;
